                   LinkSelect(evt, 'Planka2-01', 'fil10 str99999'); LinkSelect(evt, 'Planka2-05', 'fil10 str99999');
                   LinkSelect(evt, 'Planka1-01', 'fil10 str99999'); LinkSelect(evt, 'Planka1-05', 'fil10 str99999');  break;
   case "MP21-03": zoomin('440 470 450 230'); boardmovetext ('MP21-03_06', 'CUP3', '', '', '', ''); LinkSelect(evt, 'Planka2-04', 'fil10 str99999');  break;
   case "MP22": zoomin('440 270 450 230'); boardmovetext ('MP22_01', 'CUP2', '', '', '', ''); LinkSelect(evt, 'Planka1-02', 'fil10 str99999'); 
                LinkSelect(evt, 'Planka1-03', 'fil10 str99999'); LinkSelect(evt, 'Planka1-04', 'fil10 str99999'); break;         
   case "MP3": zoomin('440 670 450 230'); boardmovetext ('MP3_01', 'CUP4', '', '', '', ''); LinkSelect(evt, 'Planka3-02', 'fil10 str99999'); LinkSelect(evt, 'Planka3-03', 'fil10 str99999'); 
   			   LinkSelect(evt, 'Planka3-05', 'fil10 str99999'); LinkSelect(evt, 'Planka3-06', 'fil10 str99999');break; 
   case "MVR5": zoomin('440 670 450 230'); boardmovetext ('MVR5', 'CUP4', '', '', '', ''); LinkSelect(evt, 'Planka3-04', 'fil10 str99999');  break;        
  
   case "": break;
  }
}

var bmt;
function boardmovetext (id, cupopen1, cupopen2, cupopen3, cupopen4, cupopen5) {
 if (boardstatus[id]==null) {
   bmt=id;
   if (cupopen1!=null && cupstatus[cupopen1]!=1) { CupMove(cupopen1);
     if (cupopen2!=null && cupstatus[cupopen2]!=1) CupMove(cupopen2);
     if (cupopen3!=null && cupstatus[cupopen3]!=1) CupMove(cupopen3);
     if (cupopen4!=null && cupstatus[cupopen4]!=1) CupMove(cupopen4);
     if (cupopen5!=null && cupstatus[cupopen5]!=1) CupMove(cupopen5);               
     setTimeout("BoardMove(bmt)",1700);
   }  
   else {BoardMove(bmt);}
 }
}

