function display(evt, id, disp) {
    var element = doc.getElementById(id);
    element.setAttribute ("display", disp);     
}
function LinkSelect(evt, id, str) {
    var element = doc.getElementById(id);
    var elemscale = doc.getElementById("Tooltip");
    element.setAttribute ("class", str);
}

var stepboardO=0;
var stepboardC=0;
var boardstatus = new Array();
var oID;
var cID;
var boardout;
var boardm=0; 
function BoardMove(id) {
 if (boardm==0) {
  if (boardout==id) boardout=null;
  if (boardout!=null) {stepboardC=20; boardstatus[boardout]=null; BoardAnimationClose(boardout);}
  if (boardstatus[id]==null) {stepboardO=0; boardm=1; boardstatus[id]=1; BoardAnimationOpen(id);}
  else {stepboardC=20; boardstatus[id]=null; BoardAnimationClose(id);}
 }
}
function BoardAnimationOpen(id) {
  oID=id;
  var boardOpen = doc.getElementById(id);
  stepboardO++;
  if (stepboardO>20) {boardm=0; return;}
  boardOpen.setAttribute ("transform", "translate("+ -3*stepboardO +","+ stepboardO +")");
  boardout=id; 
  setTimeout("BoardAnimationOpen(oID)",10)
}
function BoardAnimationClose(id) {
  cID=id;
  var boardClose = doc.getElementById(id);  
  stepboardC--;
  if (stepboardC<0) {return;}
  boardClose.setAttribute ("transform", "translate("+ -3*stepboardC +","+ stepboardC +")");
  setTimeout("BoardAnimationClose(cID)",10)
}

var cup;
var cupstatus = new Array();
var ncup;
var stepcup2=0;
var stepcup3=0;
var stepcup4=0;

function CupMove(id) {
  if (cupstatus[id]==null) {
    if (id=='CUP2') CupAnimation2();
    if (id=='CUP3') CupAnimation3();    
    if (id=='CUP4') CupAnimation4();
  }  
}

function CupAnimation2() {
  cup = doc.getElementById('CUP2');
  if (stepcup2>=20) {
    stepcup2=stepcup2+10;
    if (stepcup2>450) {cupstatus['CUP2']=1;return;}
    cup.setAttribute ("transform", "translate("+ -1*stepcup2 +",20)");
  }
  else {stepcup2++; cup.setAttribute ("transform", "translate("+ -1*stepcup2 +","+ stepcup2 +")");}
  setTimeout("CupAnimation2()",10)
}

function CupAnimation3() {
  cup = doc.getElementById('CUP3');
  if (stepcup3>=20) {
    stepcup3=stepcup3+10;
    if (stepcup3>450) {cupstatus['CUP3']=1;return;}
    cup.setAttribute ("transform", "translate("+ -1*stepcup3 +",20)");
  }
  else {stepcup3++; cup.setAttribute ("transform", "translate("+ -1*stepcup3 +","+ stepcup3 +")");}
  setTimeout("CupAnimation3()",10)
}

function CupAnimation4() {
  cup = doc.getElementById('CUP4');
  if (stepcup4>=20) {
    stepcup4=stepcup4+10;
    if (stepcup4>450) {cupstatus['CUP4']=1;return;}
    cup.setAttribute ("transform", "translate("+ -1*stepcup4 +",20)");
  }
  else {stepcup4++; cup.setAttribute ("transform", "translate("+ -1*stepcup4 +","+ stepcup4 +")");}
  setTimeout("CupAnimation4()",10)
}

  function updatetips(evt, helptext1, helptext2, bgsizex, bgsizey) {
    var ToolTip = doc.getElementById("Tooltip");
	var elemtext1 = doc.getElementById("Tooltext1");
	var elemtext2 = doc.getElementById("Tooltext2");
    var elembg = doc.getElementById("Toolbg");
    
	elemtext1=elemtext1.firstChild;
    elemtext1.data = helptext1;
	elemtext2=elemtext2.firstChild;
    elemtext2.data = helptext2;
	elembg.setAttribute ("width", bgsizex);
	elembg.setAttribute ("height", bgsizey);		

    var x = evt.screenX;
    var y = evt.screenY;
  
    var SVGRoot = svgDocument.documentElement;
    var scale = SVGRoot.currentScale;
    var trans = SVGRoot.currentTranslate;
    var vbox = SVGRoot.getAttributeNS(null, "viewBox");
    var params  = vbox.split(/\s+/);

    var x1 = (( 10.0 - trans.x )+x)/scale;
    var y1 = (( -15.0 - trans.y )+y)/scale;  
  
    var h_scale = window.innerWidth / params[2];
    var v_scale = window.innerHeight / params[3];  
 
    if (h_scale>v_scale) box_scale=v_scale; 
    else box_scale=h_scale;
  
  
    var x_transl=(window.innerWidth-(box_scale*params[2]))/2;
    var y_transl=(window.innerHeight-(box_scale*params[3]))/2;  
    var vX = 1*params[0]; 
    var vY = 1*params[1]; 
    x1=(x1-x_transl)/box_scale+vX;
    y1=(y1-y_transl)/box_scale+vY;

    var toolscale =1/scale;
    toolscale=toolscale/box_scale;
    
    var xtest=bgsizex*toolscale;
    var ytest=bgsizey*toolscale;
    if (x>(window.innerWidth-xtest) && (window.innerWidth-xtest)>0) x1=x1-xtest-((25.0/scale)/box_scale);
    if (y<ytest) y1=y1-((-30.0/scale)/box_scale);
            
    ToolTip.setAttribute ("transform", "translate("+x1+", "+y1+") scale("+toolscale+")");	
  }
